--
-- Name: order_reviews; Type: TABLE; Schema: public; Owner: -
--

CREATE TABLE public.order_reviews (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    order_id uuid NOT NULL,
    user_id uuid NOT NULL,
    rating integer NOT NULL,
    comment text,
    created_at timestamp(3) without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp(3) without time zone NOT NULL
);


--
-- Name: orders; Type: TABLE; Schema: public; Owner: -
--

CREATE TABLE public.orders (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    user_id uuid NOT NULL,
    order_no text NOT NULL,
    type public.order_type NOT NULL,
    status public.order_status DEFAULT 'pending'::public.order_status NOT NULL,
    address_id uuid,
    delivery_fee numeric(12,2) DEFAULT 0 NOT NULL,
    subtotal numeric(12,2) NOT NULL,
    total numeric(12,2) NOT NULL,
    payment_type public.payment_type DEFAULT 'none'::public.payment_type NOT NULL,
    note text,
    created_at timestamp(3) without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp(3) without time zone NOT NULL,
    discount numeric(12,2) DEFAULT 0,
    coupon_id uuid,
    coupon_code character varying(255),
    CONSTRAINT delivery_fee_non_negative CHECK ((delivery_fee >= (0)::numeric)),
    CONSTRAINT delivery_needs_address CHECK ((((type = 'pickup'::public.order_type) AND (address_id IS NULL)) OR ((type = 'delivery'::public.order_type) AND (address_id IS NOT NULL)))),
    CONSTRAINT subtotal_non_negative CHECK ((subtotal >= (0)::numeric)),
    CONSTRAINT total_non_negative CHECK ((total >= (0)::numeric))
);


