CREATE TABLE public.products (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    category_id uuid NOT NULL,
    name text NOT NULL,
    slug text NOT NULL,
    description text,
    price numeric(12,2) NOT NULL,
    stock integer DEFAULT 0 NOT NULL,
    low_stock_level integer,
    unit text,
    barcode text,
    brand text,
    image_urls jsonb DEFAULT '[]'::jsonb NOT NULL,
    is_active boolean DEFAULT true NOT NULL,
    is_featured boolean DEFAULT false NOT NULL,
    created_at timestamp(3) without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp(3) without time zone NOT NULL,
    show_stock boolean DEFAULT false NOT NULL,
    ingredients_text text,
    allergens jsonb DEFAULT '[]'::jsonb,
    nutriscore_grade character varying(1),
    ecoscore_grade character varying(1),
    nutrition_data jsonb,
    openfoodfacts_categories jsonb,
    CONSTRAINT low_stock_positive CHECK (((low_stock_level IS NULL) OR (low_stock_level >= 0))),
    CONSTRAINT price_positive CHECK ((price >= (0)::numeric)),
    CONSTRAINT stock_non_negative CHECK ((stock >= 0))
);


